                <div className="Draft-stats">
                    <img src="IMG/image12.jpg" alt="Gwiazda"></img>
                    <span>5.0</span>
                    <span className="Grey"> (6) * </span>
                    <span className="Grey">USA</span>
                </div>
                <p>Life lesson with Katie Zaferson</p>
                <p><strong>From $136</strong>/ person
                </p>
            </div>
    )
}

export {Card}
